import React, {useState, useMemo} from 'react';


function App() {
    
    const consoleLogUseMemo = useMemo(() => {
        console.log(1);
    })

    const [count, setCount] = useState(0);
    
    return(
        <div>Hello!
            <button
            onClick={() => setCount(count + 1)}
            >{count === 0 ? 'Нажми на меня!' : 'Вы нажали на кнопку ' + count + 'раз'}</button>
        </div>
    )
}

export default App
